import React from 'react';
import './App.css';
import Cars from './Cars';
import CarsAndTrafficProvider from './context/CarsAndTrafficProvider';
import TrafficSignal from './TrafficSignal';

function App() {
  return (
    <div className="container">
      <CarsAndTrafficProvider>
        <Cars />
        <TrafficSignal />
      </CarsAndTrafficProvider>
    </div>
  );
}

export default App;
